  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0116066 includes chemical,
  discrete sample, physical and profile data collected from NATHANIEL B. PALMER in
  the South Pacific Ocean from 2000-02-15 to 2000-03-24 and retrieved during cruise
  NBP-00_1 and Ross_Sea_320620000215. These data include CHLOROFLUOROCARBON-11 (CFC-11),
  CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), DISSOLVED OXYGEN,
  HYDROSTATIC PRESSURE, SALINITY and WATER TEMPERATURE. The instruments used to collect
  these data include CTD and bottle. These data were collected by W. Smethie and S
  Jacobs of Columbia University; Lamont-Doherty Earth Observatory as part of the CLIVAR_Ross_Sea_320620000215
  data set.nnThe International CLIVAR Global Ocean Carbon and Repeat Hydrography Program
  carries out a systematic and global re-occupation of select WOCE/JGOFS hydrographic
  sections to quantify changes in storage and transport of heat, fresh water, carbon
  dioxide (CO2), and related parameters.\",\n\t\"license_title\": null,\n\t\"extras\":
